plot <- ggplot(tibble_to_plot, aes(var1, var2)) +
  geom_tile(aes(fill = corr), col = "white", linewidth = 1) +
  geom_text(aes(label = as.character(substr(corr, start = 1, stop = 8))), size = 3) +
  
  facet_wrap(~analysis, scales = "free",
             nrow = 4, labeller = as_labeller(labeller)) +
  
  scale_x_discrete(expand = c(0, 0)) +
  scale_y_discrete(limits = rev, expand = c(0, 0)) +
  
  scale_fill_gradient(high = "grey70", low = "grey99", na.value = NA, guide = "none") +
  
  theme_minimal() +
  theme(strip.text = element_text(face = "bold", hjust = 0),
        panel.grid.major.y = element_blank(),
        panel.grid.major.x = element_blank(),
        axis.line = element_line(linewidth = 0.5),
        axis.text = element_text(size = 7),
        axis.title = element_blank(),
        strip.placement = "outside")

plot

ggsave("supp_figure_S2.png",
       plot = plot, device = "png",
       dpi = 300, height = 8, width = 11, units = ("in"), bg = 'white')
